grid = [
    ["n", "n", "D", "n", "n"],
    ["n", "A", "B", "C", "n"],
    ["5", "6", "7", "8", "9"],
    ["n", "2", "3", "4", "n"],
    ["n", "n", "1", "n", "n"]
    ]

x, y = 0, 2
code = []
movedict = {"U":"y+=1", "R":"x+=1", "D":"y-=1", "L":"x-=1"}
inverse = {"U":"y-=1", "R":"x-=1", "D":"y+=1", "L":"x+=1"}

inputstring = """



"""
inputlist = inputstring.split("\n")

for line in inputlist:
    for char in line:
        exec(movedict[char])
        try:
            if grid[y][x] == "n" or x < 0 or y < 0:
                exec(inverse[char])
        except IndexError:
            exec(inverse[char])
    code.append(str(grid[y][x]))
print("".join(code))
